from dataclasses import dataclass
from typing import TypedDict, Union

from stw_gen_sample3_api.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message

from stw_gen_sample3_api.types.core.periph3.state_type import State


@dataclass
class Important(_Message):

    # Тактирование прибора от внешнего кварцевого генератора
    hseClock: State
    # Интерфейс взаимодействия с MRAM
    mramInterface: State
    # Модуль памяти MRAM
    mram: State
    # Модуль подсчета контрольной суммы
    crc32: State


class ImportantDict(TypedDict):

    # Тактирование прибора от внешнего кварцевого генератора
    hseClock: Union[State]

    # Интерфейс взаимодействия с MRAM
    mramInterface: Union[State]

    # Модуль памяти MRAM
    mram: Union[State]

    # Модуль подсчета контрольной суммы
    crc32: Union[State]

